import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function NavbarEs() {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="/">El Espinal SpA</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/calendar">Calendario</Nav.Link>
            <Nav.Link href="#proyectos">Proyectos</Nav.Link>
            <Nav.Link href="#personas">Personas</Nav.Link>
            <Nav.Link href="#equipos">Equipos</Nav.Link>
            <NavDropdown title="Acciones" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Asignar persona</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Asignar equipo</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.3">Crear proyecto</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Crear persona</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Crear equipo</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavbarEs;
